import React, { Component } from 'react';
import { ListGroup, ListGroupItem, Row, Col, Collapse, Button, CardBody, Card  } from 'reactstrap';

class Home extends Component{
  constructor(props) {
    super(props);
    this.toggle = this.toggle.bind(this);
    this.state = { collapse: false };
  }
  toggle() {
    this.setState(state => ({ collapse: !state.collapse }));
  }
  render(){


    return(

        <div className="container">
        <Row>
        <h3>Course Content</h3>
        </Row>
        <Button color="primary" onClick={this.toggle} style={{ marginBottom: '1rem' }}>Expand all</Button>
        <Collapse isOpen={this.state.collapse}>
          <Card>
            <CardBody>
            <ListGroup>
              <Row>
                <Col><h4>Mind and Focus</h4></Col>


                <Col><h4>8 lectures</h4></Col>
                <Col><h4>29:19</h4></Col>
              </Row>
            </ListGroup>
            </CardBody>
          </Card>
          <br />
        </Collapse>
        </div>

    );
  }
}

export default Home;
